import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h3>Welcome to Fullstack Development - 1</h3>
        <h4>React JS Programming Week09 Lab exercise</h4>
        <h5></h5>
      </header>
    </div>
  );
}

export default App;
